INSERT INTO `movie` VALUES (11,'Star Wars',11000000,'http://www.starwars.com/films/star-wars-episode-iv-a-new-hope','Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.',126.393695,'1977-05-25',852937807,121,'Released','A long time ago in a galaxy far, far away...',8.10,6624),(12,'Finding Nemo',94000000,'http://movies.disney.com/finding-nemo','Nemo, an adventurous young clownfish, is unexpectedly taken from his Great Barrier Reef home to a dentist\'s office aquarium. It\'s up to his worrisome father Marlin and a friendly but forgetful fish Dory to bring Nemo home -- meeting vegetarian sharks, surfer dude turtles, hypnotic jellyfish, hungry seagulls, and more along the way.',85.688789,'2003-05-30',987352312,100,'Released','There are 3.7 trillion fish in the ocean, they\'re looking for one.',7.60,6122),(13,'Forrest Gump',55000000,'','A man with a low IQ has accomplished great things in his life and been present during significant historic events - in each case, far exceeding what anyone imagined he could do. Yet, despite all the things he has attained, his one true love eludes him. \'Forrest Gump\' is the story of a man who rose above his challenges, and who proved that determination, courage, and love are more important than ability.',138.133331,'1994-07-06',745739938,142,'Released','The world will never be the same, once you\'ve seen it through the eyes of Forrest Gump.',8.20,7927),(14,'American Beauty',15000000,'http://www.dreamworks.com/ab/','Lester Burnham, a depressed suburban father in a mid-life crisis, decides to turn his hectic life around after developing an infatuation with his daughter\'s attractive friend.',80.878605,'1999-09-15',374111431,122,'Released','Look closer.',7.90,3313),(18,'The Fifth Element',90000000,'','In 2257, a taxi driver is unintentionally given the task of saving a young girl who is part of the key that will ensure the survival of humanity.',109.528572,'1997-05-07',290312198,126,'Released','There is no future without it.',7.30,3885),(22,'Pirates of the Caribbean: The Curse of the Black Pearl',140000000,'http://disney.go.com/disneyvideos/liveaction/pirates/main_site/main.html','Jack Sparrow, a freewheeling 17th-century pirate who roams the Caribbean Sea, butts heads with a rival pirate bent on pillaging the village of Port Royal. When the governor\'s daughter is kidnapped, Sparrow decides to help the girl\'s love save her. But their seafaring mission is hardly simple.',271.972889,'2003-07-09',720512346,143,'Released','Prepare to be blown out of the water.',7.50,6985),(24,'Kill Bill: Vol. 1',30000000,'http://www.miramax.com/movie/kill-bill-volume-1/','An assassin is shot at the altar by her ruthless employer, Bill and other members of their assassination circle – but \'The Bride\' lives to plot her vengeance. Setting out for some payback, she makes a death list and hunts down those who wronged her, saving Bill for last.',79.754966,'2003-10-10',189996450,111,'Released','Go for the kill.',7.70,4949),(58,'Pirates of the Caribbean: Dead Man\'s Chest',200000000,'http://disney.go.com/disneypictures/pirates/','Captain Jack Sparrow works his way out of a blood debt with the ghostly Davey Jones, he also attempts to avoid eternal damnation.',145.847379,'2006-06-20',1172225793,151,'Released','Jack is back!',7.00,5246),(62,'2001: A Space Odyssey',10500000,'','Humanity finds a mysterious object buried beneath the lunar surface and sets off to find its origins with the help of HAL 9000, the world\'s most advanced super computer.',86.201184,'1968-04-10',72135000,149,'Released','An epic drama of adventure and exploration',7.90,2998),(70,'Million Dollar Baby',30000000,'http://www.milliondollarbaby-derfilm.de/','Despondent over a painful estrangement from his daughter, trainer Frankie Dunn isn\'t prepared for boxer Maggie Fitzgerald to enter his life. But Maggie\'s determined to go pro and to convince Dunn and his cohort to help her.',70.456012,'2004-12-15',227601828,132,'Released','Beyond his silence, there is a past. Beyond her dreams, there is a feeling. Beyond hope, there is a memory. Beyond their journey, there is a love.',7.70,2439),(73,'American History X',20000000,'http://www.historyx.com/','Derek Vineyard is paroled after serving 3 years in prison for killing two thugs who tried to break into/steal his truck. Through his brother, Danny Vineyard\'s narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.',73.567232,'1998-10-30',25068883,119,'Released','Some Legacies Must End.',8.20,3016),(78,'Blade Runner',28000000,'http://www.warnerbros.com/blade-runner','In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.',94.056131,'1982-06-25',34796598,117,'Released','Man has made his match... now it\'s his problem.',7.90,3509),(85,'Raiders of the Lost Ark',18000000,'http://www.indianajones.com','When Dr. Indiana Jones – the tweed-suited professor who just happens to be a celebrated archaeologist – is hired by the government to locate the legendary Ark of the Covenant, he finds himself up against the entire Nazi regime.',68.159596,'1981-06-12',409422269,115,'Released','Indiana Jones - the new hero from the creators of JAWS and STAR WARS.',7.70,3854),(87,'Indiana Jones and the Temple of Doom',28000000,'http://www.indianajones.com','After arriving in India, Indiana Jones is asked by a desperate village to find a mystical stone. He agrees – and stumbles upon a secret cult plotting a terrible plan in the catacombs of an ancient palace.',66.976776,'1984-05-23',349650000,118,'Released','If adventure has a name... it must be Indiana Jones.',7.10,2781),(89,'Indiana Jones and the Last Crusade',48000000,'http://www.indianajones.com/crusade','When Dr. Henry Jones Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Indiana must team up with Marcus Brody, Sallah and Elsa Schneider to follow in his father\'s footsteps and stop the Nazis from recovering the power of eternal life.',80.972475,'1989-05-24',497880396,127,'Released','The man with the hat is back. And this time, he\'s bringing his Dad.',7.60,3152),(98,'Gladiator',103000000,'','In the year 180, the death of emperor Marcus Aurelius throws the Roman Empire into chaos. Maximus is one of the Roman army\'s most capable and trusted generals and a key advisor to the emperor. As Marcus\' devious son Commodus ascends to the throne, Maximus is set to be executed. He escapes, but is captured by slave traders. Renamed Spaniard and forced to become a gladiator, Maximus must battle to the death with other men for the amusement of paying audiences. His battle skills serve him well, and he becomes one of the most famous and admired men to fight in the Colosseum. Determined to avenge himself against the man who took away his freedom and laid waste to his family, Maximus believes that he can use his fame and skill in the ring to avenge the loss of his family and former glory. As the gladiator begins to challenge his rule, Commodus decides to put his own fighting mettle to the test by squaring off with Maximus in a battle to the death.',95.301296,'2000-05-01',480522448,155,'Released','A Hero Will Rise.',7.90,5439),(105,'Back to the Future',19000000,'http://www.backtothefuture.com/movies/backtothefuture1','Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents\' first meeting and attracting his mother\'s romantic interest. Marty must repair the damage to history by rekindling his parents\' romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.',76.603233,'1985-07-03',400165250,116,'Released','He\'s the only kid ever to get into trouble before he was born.',8.00,6079),(111,'Scarface',25000000,'','After getting a green card in exchange for assassinating a Cuban government official, Tony Montana stakes a claim on the drug trade in Miami. Viciously murdering anyone who stands in his way, Tony eventually becomes the biggest drug lord in the state, controlling nearly all the cocaine that comes through Miami. But increased pressure from the police, wars with Colombian drug cartels and his own drug-fueled paranoia serve to fuel the flames of his eventual downfall.',70.105981,'1983-12-08',69178938,170,'Released','The world is yours...',8.00,2948),(120,'The Lord of the Rings: The Fellowship of the Ring',93000000,'http://www.lordoftherings.net/','Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.',138.049577,'2001-12-18',958505200,178,'Released','One ring to rule them all',8.00,8705),(121,'The Lord of the Rings: The Two Towers',79000000,'http://www.lordoftherings.net/','Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.',106.914973,'2002-12-18',1018916140,179,'Released','A New Power Is Rising.',8.00,7487),(122,'The Lord of the Rings: The Return of the King',94000000,'http://www.lordoftherings.net','Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron\'s forces. Meanwhile, Frodo and Sam bring the ring closer to the heart of Mordor, the dark lord\'s realm.',123.630332,'2003-12-01',1230777876,201,'Released','The eye of the enemy is moving.',8.10,8064),(129,'千と千尋の神隠し',15000000,'http://movies.disney.com/spirited-away','A ten year old girl who wanders away from her parents along a path that leads to a world ruled by strange and unusual monster-like animals. Her parents have been changed into pigs along with others inside a bathhouse full of these creatures. Will she ever see the world how it once was?',118.968562,'2001-07-20',302417604,125,'Released','The tunnel led Chihiro to a mysterious town...',8.30,3840),(155,'The Dark Knight',185000000,'http://thedarkknight.warnerbros.com/dvdsite/','Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.',187.322927,'2008-07-16',1105014288,152,'Released','Why So Serious?',8.20,12002),(163,'Ocean\'s Twelve',110000000,'http://oceans12.warnerbros.com/','Danny Ocean reunites with his old flame and the rest of his merry band of thieves in carrying out three huge heists in Rome, Paris and Amsterdam – but a Europol agent is hot on their heels.',76.840712,'2004-12-09',380881494,125,'Released','Twelve is the new eleven.',6.40,2124),(189,'Sin City: A Dame to Kill For',65000000,'http://sincity-2.com/','Some of Sin City\'s most hard-boiled citizens cross paths with a few of its more reviled inhabitants.',85.428395,'2014-08-20',41377996,102,'Released','There is no justice without sin.',6.30,1286),(194,'Le fabuleux destin d\'Amélie Poulain',10000000,'http://www.die-fabelhafte-welt-der-amelie.de','At a tiny Parisian café, the adorable yet painfully shy Amélie (Audrey Tautou) accidentally discovers a gift for helping others. Soon Amelie is spending her days as a matchmaker, guardian angel, and all-around do-gooder. But when she bumps into a handsome stranger, will she find the courage to become the star of her very own love story?',73.720244,'2001-04-25',182618051,122,'Released','One person can change your life forever.',7.80,3310),(217,'Indiana Jones and the Kingdom of the Crystal Skull',185000000,'http://www.indianajones.com/site/index.html','Set during the Cold War, the Soviets – led by sword-wielding Irina Spalko – are in search of a crystal skull which has supernatural powers related to a mystical Lost City of Gold. After being captured and then escaping from them, Indy is coerced to head to Peru at the behest of a young man whose friend – and Indy\'s colleague – Professor Oxley has been captured for his knowledge of the skull\'s whereabouts.',75.674458,'2008-05-21',825967834,122,'Released','The adventure continues . . .',5.70,2495),(218,'The Terminator',6400000,'http://www.mgm.com/#/our-titles/1970/The-Terminator/','In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the \"Terminator\" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?',74.234793,'1984-10-26',82289760,108,'Released','Your future is in his hands.',7.30,4128),(238,'The Godfather',6000000,'http://www.thegodfather.com/','Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.',143.659698,'1972-03-14',269573052,175,'Released','An offer you can\'t refuse.',8.40,5893),(240,'The Godfather: Part II',13000000,'','In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.',105.792936,'1974-12-20',52297125,200,'Released','I don\'t feel I have to wipe everybody out, Tom. Just my enemies.',8.30,3338),(272,'Batman Begins',150000000,'http://www2.warnerbros.com/batmanbegins/index.html','Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.',115.040024,'2005-06-10',411640540,140,'Released','Evil fears the knight.',7.50,7359),(277,'Underworld',22000000,'http://www.sonypictures.com/movies/underworld/site/main.html','Vampires and werewolves have waged a nocturnal war against each other for centuries. But all bets are off when a female vampire warrior named Selene, who\'s famous for her strength and werewolf-hunting prowess, becomes smitten with a peace-loving male werewolf, Michael, who wants to end the war.',81.829237,'2003-09-19',100493879,121,'Released','Underworld',6.60,2512),(278,'The Shawshank Redemption',25000000,'','Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.',136.747729,'1994-09-23',31175615,142,'Released','Fear can hold you prisoner. Hope can set you free.',8.50,8205),(280,'Terminator 2: Judgment Day',100000000,'','Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.',101.741550,'1991-07-01',572000000,137,'Released','It\'s nothing personal.',7.70,4185),(285,'Pirates of the Caribbean: At World\'s End',300000000,'http://disney.go.com/disneypictures/pirates/','Captain Barbossa, long believed to be dead, has come back to life and is headed to the edge of the Earth with Will Turner and Elizabeth Swann. But nothing is quite as it seems.',139.082615,'2007-05-19',1057100000,169,'Released','At the end of the world, the adventure begins.',6.90,4500),(296,'Terminator 3: Rise of the Machines',200000000,'','It\'s been 10 years since John Connor saved Earth from Judgment Day, and he\'s now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connor\'s former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.',69.405188,'2003-07-02',456750000,109,'Released','The Machines Will Rise.',5.90,2143),(310,'Bruce Almighty',80000000,'http://www.brucealmighty.com/','Bruce Nolan toils as a \"human interest\" television reporter in Buffalo, N.Y. Despite his high ratings and the love of his beautiful girlfriend, Grace, Bruce remains unfulfilled. At the end of the worst day in his life, he angrily ridicules God -- and the Almighty responds, endowing Bruce with all of His divine powers.',109.684788,'2003-05-23',533030118,101,'Released','In Bruce we trust',6.40,3012),(348,'Alien',11000000,'https://www.facebook.com/alienanthology/','During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.',94.184658,'1979-05-25',110178391,117,'Released','In space no one can hear you scream.',7.90,4470),(350,'The Devil Wears Prada',35000000,'http://www.devilwearspradamovie.com/','The Devil Wears Prada is about a young journalist who moves to New York to work in the fashion industry. Her boss however is extremely demanding and cruel and won’t let her succeed if she doesn’t fit into the high class elegant look of their magazine when all she really wants to be a good journalist.',83.893257,'2006-06-30',342878648,109,'Released','Meet Andy Sachs. A million girls would kill to have her job. She\'s not one of them.',7.00,3088),(408,'Snow White and the Seven Dwarfs',1488423,'http://movies.disney.com/snow-white-and-the-seven-dwarfs','A beautiful girl, Snow White, takes refuge in the forest in the house of seven dwarfs to hide from her stepmother, the wicked Queen. The Queen is jealous because she wants to be known as \"the fairest in the land,\" and Snow White\'s beauty surpasses her own.',80.171283,'1937-12-20',194171760,83,'Released','The Happiest, Dopiest, Grumpiest, Sneeziest movie of the year.',6.90,1914),(411,'The Chronicles of Narnia: The Lion, the Witch and the Wardrobe',180000000,'','Siblings Lucy, Edmund, Susan and Peter step through a magical wardrobe and find the land of Narnia. There, the they discover a charming, once peaceful kingdom that has been plunged into eternal winter by the evil White Witch, Jadis. Aided by the wise and magnificent lion, Aslan, the children lead Narnia into a spectacular, climactic battle to be free of the Witch\'s glacial powers forever.',67.391328,'2005-12-07',786247304,143,'Released','Evil Has Reigned For 100 Years...',6.70,2629),(424,'Schindler\'s List',22000000,'http://www.schindlerslist.com/','The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.',104.469351,'1993-11-29',353502123,195,'Released','Whoever saves one life, saves the world entire.',8.30,4329),(425,'Ice Age',59000000,'http://www.iceagemovies.com/films/ice-age','With the impending ice age almost upon them, a mismatched trio of prehistoric critters – Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth – find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends but, when enemies attack, their quest takes on far nobler aims.',99.561972,'2002-03-10',402419992,81,'Released','They came. They thawed. They conquered.',7.10,3857),(429,'Il buono, il brutto, il cattivo',1200000,'http://www.mgm.com/#/our-titles/766/The-Good,-the-Bad-and-the-Ugly','While the Civil War rages between the Union and the Confederacy, three men – a quiet loner, a ruthless hit man and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.',88.377076,'1966-12-23',6300000,161,'Released','For three men the Civil War wasn\'t hell. It was practice.',8.10,2311),(497,'The Green Mile',60000000,'http://thegreenmile.warnerbros.com/','A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cellblock\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.',103.698022,'1999-12-10',313060000,189,'Released','Miracles do happen.',8.20,4048),(500,'Reservoir Dogs',1200000,'','A botched robbery indicates a police informant, and the pressure mounts in the aftermath at a warehouse. Crime begets violence as the survivors -- veteran Mr. White, newcomer Mr. Orange, psychopathic parolee Mr. Blonde, bickering weasel Mr. Pink and Nice Guy Eddie -- unravel.',66.925866,'1992-09-02',15394057,99,'Released','Every dog has his day.',8.00,3697),(510,'One Flew Over the Cuckoo\'s Nest',3000000,'','While serving time for insanity at a state mental hospital, implacable rabble-rouser, Randle Patrick McMurphy inspires his fellow patients to rebel against the authoritarian rule of head nurse, Mildred Ratched.',127.525581,'1975-11-18',119879402,133,'Released','If he\'s crazy, what does that make you?',8.20,2919),(534,'Terminator Salvation',200000000,'https://www.warnerbros.com/terminator-salvation','All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.',71.862892,'2009-05-20',389920651,115,'Released','The End Begins.',5.90,2463),(539,'Psycho',806948,'','When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother. The place seems quirky, but fine… until Marion decides to take a shower.',93.067866,'1960-06-16',33600000,109,'Released','The master of suspense moves his cameras into the icy blackness of the unexplored!',8.20,2320),(550,'Fight Club',63000000,'http://www.foxmovies.com/movies/fight-club','A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.',146.757391,'1999-10-15',110939128,139,'Released','