natoly Mikailavich on the Keldysh about her life set in April 10th 1912, on a ship called Titanic when young Rose boards the departing ship with the upper-class passengers and her mother, Ruth DeWitt Bukater, and her fiancé, Caledon Hockley. Meanwhile, a drifter and artist named Jack Dawson and his best friend Fabrizio De Rossi win third-class tickets to the ship in a game. And she explains the whole story from departure until the death of Titanic on its first and last voyage April 15th, 1912 at 2:20 in the morning.',100.025899,'1997-11-18',2029537606,194,'Released','Nothing on Earth could come between them.',7.50,7562),(603,'The Matrix',63000000,'http://www.warnerbros.com/matrix','Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.',104.309993,'1999-03-30',509869121,136,'Released','Welcome to the Real World.',7.90,8907),(604,'The Matrix Reloaded',150000000,'','Six months after the events depicted in The Matrix, Neo has proved to be a good omen for the free humans, as more and more humans are being freed from the matrix and brought to Zion, the one and only stronghold of the Resistance.  Neo himself has discovered his superpowers including super speed, ability to see the codes of the things inside the matrix and a certain degree of pre-cognition. But a nasty piece of news hits the human resistance: 250,000 machine sentinels are digging to Zion and would reach them in 72 hours. As Zion prepares for the ultimate war, Neo, Morpheus and Trinity are advised by the Oracle to find the Keymaker who would help them reach the Source.  Meanwhile Neo\'s recurrent dreams depicting Trinity\'s death have got him worried and as if it was not enough, Agent Smith has somehow escaped deletion, has become more powerful than before and has fixed Neo as his next target.',70.785910,'2003-05-15',775529686,138,'Released','Free your mind.',6.70,3443),(605,'The Matrix Revolutions',150000000,'','The human city of Zion defends itself against the massive invasion of the machines as Neo fights to end the war at another front while also opposing the rogue Agent Smith.',73.313918,'2003-11-05',446237621,129,'Released','Everything that has a beginning has an end.',6.40,3096),(607,'Men in Black',90000000,'http://www.sonypictures.com/homevideo/meninblack/','Men in Black follows the exploits of agents Kay and Jay, members of a top-secret organization established to monitor and police alien activity on Earth. The two Men in Black find themselves in the middle of the deadly plot by an intergalactic terrorist who has arrived on Earth to assassinate two ambassadors from opposing galaxies. In order to prevent worlds from colliding, the MiB must track down the terrorist and prevent the destruction of Earth. It\'s just another typical day for the Men in Black.',104.121555,'1997-07-02',648329592,98,'Released','Protecting the Earth from the scum of the universe.',6.90,4412),(608,'Men in Black II',140000000,'http://www.sonypictures.com/homevideo/meninblackii/','Kay and Jay reunite to provide our best, last and only line of defense against a sinister seductress who levels the toughest challenge yet to the MIB\'s untarnished mission statement – protecting Earth from the scum of the universe. It\'s been four years since the alien-seeking agents averted an intergalactic disaster of epic proportions. Now it\'s a race against the clock as Jay must convince Kay – who not only has absolutely no memory of his time spent with the MIB, but is also the only living person left with the expertise to save the galaxy – to reunite with the MIB before the earth submits to ultimate destruction.',91.332849,'2002-07-03',463909743,88,'Released','Same Planet. New Scum.',6.00,3114),(621,'Grease',6000000,'','Australian good girl Sandy and greaser Danny fell in love over the summer. But when they unexpectedly discover they\'re now in the same high school, will they be able to rekindle their romance despite their eccentric friends?',67.608041,'1978-07-07',190904458,110,'Released','Grease is the word',7.20,1581),(630,'The Wizard of Oz',2777000,'http://thewizardofoz.warnerbros.com/','Young Dorothy finds herself in a magical world where she makes friends with a lion, a scarecrow and a tin man as they make their way along the yellow brick road to talk with the Wizard and ask for the things they miss most in their lives. The Wicked Witch of the West is the only thing that could stop them.',67.417542,'1939-08-15',35442715,102,'Released','We\'re off to see the Wizard, the wonderful Wizard of Oz!',7.40,1642),(640,'Catch Me If You Can',52000000,'https://www.facebook.com/CatchMeIfYouCanMovie','A true story about Frank Abagnale Jr. who, before his 19th birthday, successfully conned millions of dollars worth of checks as a Pan Am pilot, doctor, and legal prosecutor. An FBI agent makes it his mission to put him behind bars. But Frank not only eludes capture, he revels in the pursuit.',73.944049,'2002-12-25',369720027,141,'Released','The true story of a real fake.',7.70,3795),(652,'Troy',175000000,'','In year 1250 B.C. during the late Bronze age, two emerging nations begin to clash. Paris, the Trojan prince, convinces Helen, Queen of Sparta, to leave her husband Menelaus, and sail with him back to Troy. After Menelaus finds out that his wife was taken by the Trojans, he asks his brother Agamemnom to help him get her back. Agamemnon sees this as an opportunity for power. So they set off with 1,000 ships holding 50,000 Greeks to Troy. With the help of Achilles, the Greeks are able to fight the never before defeated Trojans.',66.803149,'2004-05-13',522280344,163,'Released','For passion. For honor. For destiny. For victory. For love.',6.90,2759),(671,'Harry Potter and the Philosopher\'s Stone',125000000,'http://harrypotter.warnerbros.com/harrypotterandthedeathlyhallows/mainsite/index.html','Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths -- and about the villain who\'s to blame.',109.984351,'2001-11-16',1074123105,152,'Released','Let the Magic Begin.',7.50,7006),(672,'Harry Potter and the Chamber of Secrets',100000000,'','Ignoring threats to his life, Harry returns to Hogwarts to investigate – aided by Ron and Hermione – a mysterious series of attacks.',132.397737,'2002-11-13',964357330,161,'Released','Hogwarts is back in session.',7.40,5815),(673,'Harry Potter and the Prisoner of Azkaban',130000000,'','Harry, Ron and Hermione return to Hogwarts for another magic-filled year. Harry comes face to face with danger yet again, this time in the form of escaped convict, Sirius Black – and turns to sympathetic Professor Lupin for help.',79.679601,'2004-05-31',829294781,141,'Released','Something wicked this way comes.',7.70,5877),(674,'Harry Potter and the Goblet of Fire',150000000,'http://harrypotter.warnerbros.com/','Harry starts his fourth year at Hogwarts, competes in the treacherous Triwizard Tournament and faces the evil Lord Voldemort. Ron and Hermione help Harry manage the pressure – but Voldemort lurks, awaiting his chance to destroy Harry and all that he stands for.',101.250416,'2005-11-05',985513139,157,'Released','Dark And Difficult Times Lie Ahead.',7.50,5608),(675,'Harry Potter and the Order of the Phoenix',150000000,'http://www.harrypotterorderofthephoenix.com/','Returning for his fifth year of study at Hogwarts, Harry is stunned to find that his warnings about the return of Lord Voldemort have been ignored. Left with no choice, Harry takes matters into his own hands, training a small group of students – dubbed \'Dumbledore\'s Army\' – to defend themselves against the dark arts.',78.