t police, he finds in her an ally with whom he can continue his fight to free the people of Britain.',84.630969,'2006-03-15',139136586,132,'Released','People should not be afraid of their governments. Governments should be afraid of their people.',7.70,4442),(767,'Harry Potter and the Half-Blood Prince',250000000,'http://harrypotter.warnerbros.com/harrypotterandthehalf-bloodprince/dvd/index.html','As Harry begins his sixth year at Hogwarts, he discovers an old book marked as \'Property of the Half-Blood Prince\', and begins to learn more about Lord Voldemort\'s dark past.',98.885637,'2009-07-07',980657156,153,'Released','Dark Secrets Revealed',7.40,5293),(772,'Home Alone 2: Lost in New York',18000000,'','Instead of flying to Florida with his folks, Kevin ends up alone in New York, where he gets a hotel room with his dad\'s credit card—despite problems from a clerk and meddling bellboy. But when Kevin runs into his old nemeses, the Wet Bandits, he\'s determined to foil their plans to rob a toy store on Christmas eve.',81.487685,'1992-11-19',376941265,120,'Released','He\'s up past his bedtime in the city that never sleeps.',6.30,2395),(782,'Gattaca',36000000,'','Science fiction drama about a future society in the era of indefinite eugenics where humans are set on a life course depending on their DNA. The young Vincent Freeman is born with a condition that would prevent him from space travel, yet he is determined to infiltrate the GATTACA space program.',70.398356,'1997-09-07',13159415,106,'Released','There is no gene for the human spirit.',7.50,1808),(807,'Se7en',33000000,'http://www.sevenmovie.com/','Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killer\'s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.',79.579532,'1995-09-22',343677451,127,'Released','Seven deadly sins. Seven ways to die.',8.10,5765),(808,'Shrek',60000000,'http://www.shrek.com/','It ain\'t easy bein\' green -- especially if you\'re a likable (albeit smelly) ogre named Shrek. On a mission to retrieve a gorgeous princess from the clutches of a fire-breathing dragon, Shrek teams up with an unlikely compatriot -- a wisecracking donkey.',67.298732,'2001-05-16',508629678,90,'Released','The greatest fairy tale never told.',7.30,4056),(812,'Aladdin',28000000,'http://movies.disney.com/aladdin','Princess Jasmine grows tired of being forced to remain in the palace and she sneaks out into the marketplace  in disguise where she meets street-urchin Aladdin and the two fall in love, although she may only marry a prince. After being thrown in jail, Aladdin and becomes embroiled in a plot to find a mysterious lamp with which the evil Jafar hopes to rule the land.',92.982009,'1992-11-25',529252729,90,'Released','Wish granted!',7.40,3416),(854,'The Mask',23000000,'','When timid bank clerk Stanley Ipkiss discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle. Unfortunately, under the mask\'s influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell, whose goons get blamed for the heist.',85.303180,'1994-07-29',369162577,101,'Released','From zero to hero.',6.60,2472),(857,'Saving Private Ryan',70000000,'','As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetrating German-held territory and bringing the boy home.',76.041867,'1998-07-24',505932954,169,'Released','The mission is a man.',7.90,5048),(862,'Toy Story',30000000,'http://toystor