sionimpossible.com/','When Ethan Hunt, the leader of a crack espionage team whose perilous operation has gone awry with no explanation, discovers that a mole has penetrated the CIA, he\'s surprised to learn that he\'s the No. 1 suspect. To clear his name, Hunt now must ferret out the real double agent and, in the process, even the score.',75.290998,'1996-05-22',480581176,110,'Released','Expect the Impossible.',6.70,2631),(1124,'The Prestige',40000000,'http://wwws.warnerbros.de/theprestige/','A mysterious story of two magicians whose intense rivalry leads them on a life-long battle for supremacy -- full of obsession, deceit and jealousy with dangerous and deadly consequences.',74.440708,'2006-10-19',115160126,130,'Released','Are You Watching Closely?',8.00,4391),(1366,'Rocky',1000000,'','When world heavyweight boxing champion, Apollo Creed wants to give an unknown fighter a shot at the title as a publicity stunt, his handlers choose palooka Rocky Balboa, an uneducated collector for a Philadelphia loan shark. Rocky teams up with trainer  Mickey Goldmill to make the most of this once in a lifetime break.',72.198080,'1976-11-21',123096904,119,'Released','His whole life was a million-to-one shot.',7.50,1791),(1402,'The Pursuit of Happyness',55000000,'http://www.sonypictures.com/homevideo/thepursuitofhappyness/','The true story of Christopher Gardner, who invests heavily in a device known as a \'Bone Density Scanner\', only to find himself struggle to sell the product as it\'s just marginally better than the current technology, and much more expensive. His wife leaves him,  he loses his house, bank account and credit cards and, now forced to live out in the streets with his young son,  he\'s desperate to find a steady job. He takes on a job as a stockbroker but, before he can receive pay, he needs to go through 6 months of training, and must sell his devices.',80.581367,'2006-12-14',322431159,117,'Released','',7.70,2525),(1417,'El laberinto del fauno',19000000,'http://www