ishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.',86.493424,'2011-04-21',471792948,115,'Released','Two worlds. One hero.',6.60,6525),(10674,'Mulan',90000000,'','A tomboyish girl disguises herself as a young man so she can fight with the Imperial Chinese Army against the invading Huns. With help from wise-cracking dragon Mushu, Mulan just might save her country -- and win the heart of handsome Captain Li Shang.',67.427755,'1998-06-18',319536266,88,'Released','This time, the princess saves the prince.',7.60,2008),(10681,'WALL·E',180000000,'http://disney.go.com/disneypictures/wall-e/','WALL·E is the last robot left on an Earth that has been overrun with garbage and all humans have fled to outer space. For 700 years he has continued to try and clean up the mess, but has developed some rather interesting human-like qualities. When a ship arrives with a sleek new type of robot, WALL·E thinks he\'s finally found a friend and stows away on the ship when it leaves.',66.390712,'2008-06-22',547377453,98,'Released','An adventure beyond the ordinar-E.',7.80,6296),(10764,'Quantum of Solace',200000000,'http://www.mgm.com/view/movie/234/Quantum-of-Solace/','Quantum of Solace continues the adventures of James Bond after Casino Royale. Betrayed by Vesper, the woman he loved, 007 fights the urge to make his latest mission personal. Pursuing his determination to uncover the truth, Bond and M interrogate Mr. White, who reveals that the organization that blackmailed Vesper is far more complex and dangerous than anyone had imagined.',107.928811,'2008-10-30',644699799,106,'Released','For love, for hate, for justice, for revenge.',6.10,2965),(11324,'Shutter Island',80000000,'http://www.shutterisland.com/','World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by 