o it.  When Alex Murphy – a loving husband, father and good cop doing his best to stem the tide of crime and corruption in Detroit – is critically injured, OmniCorp sees their chance to build a part-man, part-robot police officer.  OmniCorp envisions a RoboCop in every city and even more billions for their shareholders, but they never counted on one thing: there is still a man inside the machine.',66.757869,'2014-01-30',254823413,102,'Released','We\'ve got the future under control.',5.70,2342),(98566,'Teenage Mutant Ninja Turtles',125000000,'http://www.teenagemutantninjaturtlesmovie.com','The city needs heroes. Darkness has settled over New York City as Shredder and his evil Foot Clan have an iron grip on everything from the police to the politicians. The future is grim until four unlikely outcast brothers rise from the sewers and discover their destiny as Teenage Mutant Ninja Turtles. The Turtles must work with fearless reporter April and her wise-cracking cameraman Vern Fenwick to save the city and unravel Shredder\'s diabolical plan.',143.350376,'2014-08-07',524920000,101,'Released','Mysterious. Dangerous. Reptilious. You\'ve never seen heroes like this.',5.80,2636),(99861,'Avengers: Age of Ultron',280000000,'http://marvel.com/movies/movie/193/avengers_age_of_ultron','When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.',134.279229,'2015-04-22',1545944063,141,'Released','A New Age Has Come.',7.30,6767),(100042,'Dumb and Dumber To',40000000,'','20 years after the dimwits set out on their first adventure, they head out in search of one of their long lost children in the hope of gaining a new kidney.',67.767785,'2014-11-12',178328